import React, {userState} from 'react';
import { Link } from 'react-router-dom';
import logoIcon from '../Responsivo/logo.png';
import userLoginIcon from '../icons/header-user.svg'; 

console.log(logo);

function Navbar() {
  return (
        <>
          <nav className="navbar">
              <div className="navbar-container">
                  <Link to="/" className="navbar-logo">
                    <figure>
                      <img src={logo-icon} alt="Logo do Portal UFU" />
                    </figure>
                  </Link>
                  <Link to="/" className='login-button'>
                    <div className="login-icon-div">
                      <img src={user-login-icon} alt="Login" />
                    </div>
                  </Link>
              </div>
          </nav>
        </>
  );
}

export default Navbar;
